  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:35.577709\",\n\t\"name\": \"contaminant-residue-analysis-of-fish-tissues-from-marais-des-cygnes-nwr-kansas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Marais des Cygnes National Wildlife Refuge
  (Refuge) was added to the National Wildlife Refuge system in 1992. During public
  involvement in acquisition planning, the Service committed to opening the Refuge
  to recreational fishing. There are several water bodies on the Refuge which would
  provide recreational fishing opportunities. These include abandoned coal strip mines,
  small man-made farm ponds, and the Marais des Cygnes River and several tributaries
  to the river. As part of the obligation to provide safe recreational opportunities,
  an investigation of fish tissues was conducted to ensure that the fish are not contaminated
  by inorganic or organic pollutants, and to establish that it is appropriate for
  the Service to open the Refuge to public fishing. We collected edible tissue (fillet)
  samples from several species of fish from 13 sites at the Refuge. These samples
  were analyzed for trace element, chlorinated hydrocarbon, and total petroleum hydrocarbon
  residues. Numerous elements and compounds were detected in the fish tissues. Mean
  concentrations were calculated and compared to consumption values established for
  the protection of human health. Based on the results of this study, consumption
  advisories do not need to be established for the waterbodies sampled in 1998 for
  trace elements or chlorinated hydrocarbons. The results for total petroleum hydrocarbons
  should be considered provisional, pending additional examination.\",\n\t\"license_title\":
